import React from 'react'

 const ExpenseDate = ({date}) => {
  const day = date.getDate();
  const month = date.getDate();
  const year = date.getFullYear();

  return (
    <div>
      <div>{year}</div>
      <div>{month}</div>
      <div>{day}</div>
    </div>
  )
}

export default ExpenseDate;
